import { useState } from "react";
import {
  getRegularSchedule,
  getTimeOffByUserId
} from "../../api/peopleApi";

const DAYS = [
  "Sunday","Monday","Tuesday","Wednesday",
  "Thursday","Friday","Saturday"
];

function ScheduleView() {
  const [userId, setUserId] = useState("");
  const [regular, setRegular] = useState([]);
  const [timeOff, setTimeOff] = useState([]);
  const [loading, setLoading] = useState(false);

  const load = async () => {
    if (!userId) return;

    setLoading(true);

    try {
      const reg = await getRegularSchedule(userId);
      setRegular(Array.isArray(reg) ? reg : []);
    } catch {
      setRegular([]);
    }

    try {
      const off = await getTimeOffByUserId(userId);
      setTimeOff(Array.isArray(off) ? off : []);
    } catch {
      setTimeOff([]);
    }

    setLoading(false);
  };

  return (
    <div style={{ maxWidth: 1000 }}>
      <h2>üìÖ Employee Schedule</h2>

      <input
        placeholder="User ID"
        value={userId}
        onChange={e => setUserId(e.target.value)}
      />
      <button onClick={load} disabled={loading}>
        {loading ? "Loading..." : "Load"}
      </button>

      {/* ===== REGULAR SHIFTS ===== */}
      <h3>üîÅ Regular Weekly Shifts</h3>
      <table border="1" width="100%" cellPadding="6">
        <thead>
          <tr>
            <th>Day</th>
            <th>Start</th>
            <th>End</th>
          </tr>
        </thead>
        <tbody>
          {regular.length === 0 && (
            <tr>
              <td colSpan="3" align="center">
                No regular shifts
              </td>
            </tr>
          )}

          {regular.map((r, i) => (
            <tr key={i}>
              <td>{DAYS[r.dayOfWeek]}</td>
              <td>{r.startTime}</td>
              <td>{r.endTime}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* ===== TIME OFF ===== */}
      <h3>üõë Time-Off Requests</h3>
      <table border="1" width="100%" cellPadding="6">
        <thead>
          <tr>
            <th>Date</th>
            <th>From</th>
            <th>To</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {timeOff.length === 0 && (
            <tr>
              <td colSpan="4" align="center">
                No time-off requests
              </td>
            </tr>
          )}

          {timeOff.map((t, i) => (
            <tr key={i}>
              <td>{t.date}</td>
              <td>{t.startTime}</td>
              <td>{t.endTime}</td>
              <td>{t.approved ? "‚úÖ Approved" : "‚è≥ Pending"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ScheduleView;
